import PiXIcon from '../../components/assets/PiXIcon';

class DiscoverNav extends React.Component {
  constructor(props: any){
    super(props);
  }

  render(){
    return(
      <div className="DiscoverNav-Component container">
        <PiXIcon/>
      </div>
    );
  }
}

export default DiscoverNav;
